import React from 'react'
import { LoremIpsum, Avatar } from 'react-lorem-ipsum';
function Home()
{
    return(
        <div className='text-center container'>
          <p className="display-1 text-secondary">Welcome to home page</p>
          <img className="w-75" src="https://images.pexels.com/photos/414102/pexels-photo-414102.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
        
          <LoremIpsum p={3} />
        
        </div>
    )

    
}
export default Home
